import React from 'react'
import {Route} from "react-router-dom";
import auth from './auth'

export const ProtectedRout=({component:Component, ...rest})=>{
    return (
        <Route  {...rest}  render={
            (props)=>{
                if(auth.isAuthenticated()) {
                    return <Component {...props}/>
                }else {
                    
                }
            }
        }/>
    )
}
